QTD_COLUNA	DW 224

PIVO_X		DW	0
PIVO_Y		DW	0

CONT		DW	0
CONT2		DW 	0

.CODE

MAIN PROC

	MOV AX, @DATA
	MOV DS, AX
	MOV CX,0
	
	MOV AX,13H
	INT 10H	
	
	NOME_QUALQUER:
	INC CX
	ADD PIVO_X,0 
	ADD PIVO_Y,0
	
	;LEA SI,MAPA_01
	;CALL PRINT
	
	ADD PIVO_X,68
	ADD PIVO_Y,50
		
	INPUT:
	MOV AH,06h		; seek for an input
	MOV DL,0FFh
	INT 21h
	JZ INPUT
	
	DIRECTION PROC
	CMP AL,72 ;UP    / 119 = W
	JE UUU
	CMP AL,75 ;LEFT  /  97 = A
	JE LLL
	CMP AL,80 ;DOWN  / 115 = S
	JE DDD
	CMP AL,77 ;RIGHT / 100 = D
	JE RRR
	JMP INPUT
		
	UUU:
	CALL UP
	LLL:
	CALL LEFT
	DDD:
	CALL DOWN
	RRR:
	CALL RIGHT
	DIRECTION ENDP
	
	RIGHT PROC
	RIGHT_2:
	MOV QTD_LINHA,15
	MOV QTD_COLUNA,16
	LEA SI,FANT_R		
	CALL PRINT	
	;INC CONT
	ADD PIVO_X,1
	;CMP CONT,80
	MOV AH,06h		; seek for an input
	MOV DL,0FFh
	INT 21h
	JZ RIGHT_2
	CALL DIRECTION
	EXIT_RIGHT:
	JMP FINAL
	RIGHT ENDP
	
	LEFT PROC
	LEFT_2:
	MOV QTD_LINHA,15
	MOV QTD_COLUNA,16
	LEA SI,FANT_R		
	CALL PRINT	
	;INC CONT
	SUB PIVO_X,1
	;CMP CONT,80
