	INT 21h
	JZ LEFT_2
	CALL DIRECTION
	EXIT_LEFT:
	JMP FINAL
	LEFT ENDP
	
	UP PROC
	UP_2:
	MOV QTD_LINHA,15
	MOV QTD_COLUNA,16
	LEA SI,FANT_R		
	CALL PRINT	
	;INC CONT
	SUB PIVO_Y,1
	;CMP CONT,80
	MOV AH,06h		; seek for an input
	MOV DL,0FFh
	INT 21h
	JZ UP_2
	CALL DIRECTION
	EXIT_UP:
	JMP FINAL
	UP ENDP
	
	DOWN PROC
	DOWN_2:
	MOV QTD_LINHA,15
	MOV QTD_COLUNA,16
	LEA SI,FANT_R		
	CALL PRINT	
	;INC CONT
	ADD PIVO_Y,1
	;CMP CONT,80
