PRINT PROC
	MOV BX,PIVO_X		
	ADD EIXO_X,BX		;O eixo X tem a coordena do primeiro pixel em X da matriz, quando somado com o pivo, o inicio  deslocado
	ADD QTD_COLUNA,BX	;A QTD_COLUNA tem a coordenada do ultimo pixel da coluna, e tbm  somado ao pivo 
	
	MOV BX,PIVO_Y		
	ADD EIXO_Y,BX		;Mesma coisa com Y e as linhas
	ADD QTD_LINHA,BX 	;
	
INICIO:
						;Sem alteraes daqui
	MOV BX,QTD_COLUNA  	;colunas
	CMP	EIXO_X, BX    	
		JNE COR_PIXEL
	
	MOV BX,QTD_LINHA   	;linhas
	CMP	EIXO_Y, BX	  
		JE	FIM_PRINT	
	INC EIXO_Y
	MOV BX,PIVO_X
	MOV	EIXO_X,BX	
		JMP INICIO		;At aqui
		
	COR_PIXEL:
	MOV AL,[SI]	        ;;;;;;;;;;;AL recebe a cor do endereo de SI 
	MOV AH,0			;;;;;;;;;;;O byte high de AX  zerado (tinha os lixo desgraado) 
	MOV COR,AL 			

	MOV	AH, 0CH			;A partir daqui printa a cor na coordena dos EIXO_
	MOV	CX,	EIXO_X
	MOV DX, EIXO_Y
	MOV AL,	COR
	INT	10H		
	INC SI
	INC EIXO_X	
	JMP	INICIO 	
	
	FIM_PRINT:
	MOV EIXO_X,0
	MOV EIXO_Y,0	
	RET	
	
PRINT ENDP



PULA_LINHA PROC 
    
	MOV AH,2h
	MOV DX,0Ah
	INT 21h
	
	MOV AH,2h
	MOV DX,0Dh
	INT 21h
	RET
	PULA_LINHA ENDP




FINAL:

	
MOV AH,4CH
INT 21H
